window.bookSummaryJSON = "<p>My name is Nilsa.<br> <br> I am the last living Shadow.</p> <p>Mate to six broken immortal pirates.<br> <br> And now the world knows.<br> <br> For centuries, the Eagle of Galmere has been butchering the other races to create the Mortal Cure, an elixir that gives her the illusion of immortality. The human queen’s obsession with living forever has crippled empires, maimed countless innocents, and enslaved hundreds more—including my men.<br> <br> I'm the only one capable of ending her blood soaked reign, but what if the cost is far worse than we'd ever imagined?<br> <br> <b>This is a medium burn reverse harem novel intended for readers age 18 years and over. Book three of three in the Deadwood series.</b></p>"; 
